\begin{align*}
(u+4)(u-1) - (u-3)(u+6) &= uu+4u-u-4 + u-1 - 1(-6) + u(-3)+(-3)(u+6)\\
&= uu+3u+6u+3 - u - 4 + u-1 + 6u-3\\
&= \boxed{4u+6}
\end{align*}
Therefore, the simplified expression is $4u+6$. The answer is: 4u+6.
